import React from "react";

import { Grid, Stack } from "@mui/material";
import IntroduceBox from "../../components/IntroduceBox";

import photoGallery1 from "../../assets/img/aboutus/photoGallery1.png";
import photoGallery2 from "../../assets/img/aboutus/photoGallery2.png";
import photoGallery3 from "../../assets/img/aboutus/photoGallery3.png";
import photoGallery4 from "../../assets/img/aboutus/photoGallery4.png";
import photoGallery5 from "../../assets/img/aboutus/photoGallery5.png";
import CustomBox from "../../components/CustomBox";

function PhotoGallery() {
  return (
    <Grid
      container
      spacing={2}
      justifyContent="center"
      alignItem="center"
      mt={3}
    >
      <Grid item xs={12} lg={12}>
        <IntroduceBox firstLine="Photo" secondLine="Gallery" />
      </Grid>
      <Grid item xs={12} lg={12}>
        <Stack direction="row">
          <CustomBox>
            <img src={photoGallery1} alt="" />
          </CustomBox>
          <CustomBox>
            <img src={photoGallery2} alt="" />
          </CustomBox>
          <CustomBox>
            <img src={photoGallery3} alt="" />
          </CustomBox>
          <CustomBox>
            <img src={photoGallery4} alt="" />
          </CustomBox>
          <CustomBox>
            <img src={photoGallery5} alt="" />
          </CustomBox>
        </Stack>
      </Grid>
    </Grid>
  );
}

export default PhotoGallery;
